package leetcode;

import java.util.ArrayList;
import java.util.HashMap;

/**
 * @Author Lings
 * @Version 1.0
 */
public class leetcode423 {
    public static void main(String[] args) {
        System.out.println(originalDigits("owoztneoer")); // 012
        System.out.println(originalDigits("fviefuro")); // 45
        System.out.println(originalDigits("zerozerozeroone")); // 0001
        String s = "";
        System.out.println(originalDigits(s));
        System.out.println(originalDigits("zeroonetwothreefourfivesixseveneightnine"));
        System.out.println(originalDigits("onethreefivesevennine"));
    }

    public static String originalDigits(String s) {
        // 题目分析：
        // zero one two three four five six seven eight nine
        // 可以分析得出 0-9 英文字母里面，有些字母他有自己的专属字母
        // 分别为 ： zero z, two w, four u, six x, eight g
        // 这样取对应字母的数量就可以得到对应数字的数量，取完后分别减去数字数量，这是第一轮
        // 第二轮，以此类推，得到 one o,three r t h,five f, seven s ，同样计算
        // 最后剩下  nine ，同样计算
        // 这样分析下来就得到各个数字数量的num，根据数量拼接字符串输出即可
        if (s.length() < 3 )
            return "";
        // 初始化 存储 0-9 数字的个数 为 0
        HashMap<Integer,Integer> num = new HashMap<>();
        for (int i = 0; i < 10; i++)
            num.put(i,0);
        // 初始化 存储 英文 0-9 字母的个数为 0
        char[] c = {'e','g','f','i','h','o','n','s','r','u','t','w','v','x','z'};
        HashMap<Character,Integer> m = new HashMap<>();
        for (char v : c)
            m.put(v, 0);
        // 根据传进来的字符串取各个字母数量
        char[] sc = s.toCharArray();
        for (char v : sc)
            m.put(v, m.get(v)+1);

        // zero z
        num.put(0,m.get('z'));
        m.put('e',m.get('e') - m.get('z'));
        m.put('r',m.get('r') - m.get('z'));
        m.put('o',m.get('o') - m.get('z'));
        m.put('z',m.get('z') - m.get('z'));
        // two w
        num.put(2,m.get('w'));
        m.put('t',m.get('t') - m.get('w'));
        m.put('o',m.get('o') - m.get('w'));
        m.put('w',m.get('w') - m.get('w'));
        // four u
        num.put(4,m.get('u'));
        m.put('f',m.get('f') - m.get('u'));
        m.put('r',m.get('r') - m.get('u'));
        m.put('o',m.get('o') - m.get('u'));
        m.put('u',m.get('u') - m.get('u'));
        // six x
        num.put(6,m.get('x'));
        m.put('s',m.get('s') - m.get('x'));
        m.put('i',m.get('i') - m.get('x'));
        m.put('x',m.get('x') - m.get('x'));
        // eight g
        num.put(8,m.get('g'));
        m.put('e',m.get('e') - m.get('g'));
        m.put('i',m.get('i') - m.get('g'));
        m.put('h',m.get('h') - m.get('g'));
        m.put('t',m.get('t') - m.get('g'));
        m.put('g',m.get('g') - m.get('g'));

        // one three five seven nine
        // one o
        num.put(1,m.get('o'));
        m.put('n',m.get('n') - m.get('o'));
        m.put('e',m.get('e') - m.get('o'));
        m.put('o',m.get('o') - m.get('o'));
        // three r t h
        num.put(3,m.get('r'));
        m.put('t',m.get('t') - m.get('r'));
        m.put('h',m.get('h') - m.get('r'));
        m.put('e',m.get('e') - m.get('r') * 2);
        m.put('r',m.get('r') - m.get('r'));
        // five f
        num.put(5,m.get('f'));
        m.put('i',m.get('i') - m.get('f'));
        m.put('v',m.get('v') - m.get('f'));
        m.put('e',m.get('e') - m.get('f'));
        m.put('f',m.get('f') - m.get('f'));
        // seven s
        num.put(7,m.get('s'));
        m.put('v',m.get('v') - m.get('s'));
        m.put('n',m.get('n') - m.get('s'));
        m.put('e',m.get('e') - m.get('s') * 2);
        m.put('s',m.get('s') - m.get('s'));
        // nine
        num.put(9,m.get('e'));
        m.put('i',m.get('i') - m.get('e'));
        m.put('n',m.get('n') - m.get('e') * 2);
        m.put('e',m.get('e') - m.get('e'));

        //拼接字符串
        StringBuilder sb = new StringBuilder();
        for (int i = 0; i < 10; i++) {
            for (int j = 0; j < num.get(i); j++) {
                sb.append(i);
            }
        }
        s = sb.toString();
        return s;
    }
}
